function getColorValor(VALOR) {
    switch (VALOR) {
      case 'MUY ALTO':
        return { color: "#F82909", weight: 2 };
      case 'ALTO':
        return { color: "#D69C14", weight: 2 };
      case 'MEDIO ALTO':
        return { color: "#f5e869", weight: 2 };
        case 'MEDIO':
            return { color: "#44F334", weight: 2 };
          case 'MEDIO BAJO':
            return { color: "#3A86F7", weight: 2 }; 
      default:
        return { color: "black", weight: 1 }; // Estilo por defecto
    }
  }
  function styleVALOR(feature) {
    const { color, weight } = getColorValor(feature.properties.VALOR);
    return {
      color: color,
      weight: weight,
      opacity: 0.5,
      dashArray: "1",
      fillOpacity: 0.9,
    };
  }
  
  function createLegendVALOR() {
    var legend = L.control({ position: "bottomright" });
  
    legend.onAdd = function () {
      var div = L.DomUtil.create("div", "info legend");
      var labels = [];
  
      // Array con los estilos y sus etiquetas correspondientes
      var styles = [
        { label: "VALOR", color: "" },
        { label: "MUY ALTO", color: "#F82909" },
        { label: "ALTO", color: "#D69C14" },
        { label: "MEDIO ALTO", color: "#f5e869" },
        { label: "MEDIO", color: "#44F334" },
        { label: "BAJO", color: "#3A86F7" },
  
        ];
      // Genera el contenido HTML de la leyenda
      styles.forEach(function (style) {
        labels.push(
          '<i style="background:' + style.color + '"></i> ' + style.label
        );
      });
  
      div.innerHTML = labels.join("<br>");
      return div;
    };
  
    // Funci√≥n para mostrar/ocultar la leyenda
    function toggleLegend() {
      if (map.hasLayer(Valordelsuelo)) {
        legend.addTo(map);
      } else {
        legend.remove();
      }
    }
  
    // Eliminar la leyenda al inicio
    legend.remove();
    // Escucha el cambio de estado de la capa
    map.on("overlayadd overlayremove", toggleLegend);
  }
  

// funcion popous Con cuadro de texto - faltan definir los estilos1 2 3
function onEachFeature(feature, layer) {
    if (feature.properties && feature.properties.popupContent) {
        layer.bindPopup(feature.properties.popupContent);
    }
}
function valor_pop(feature, layer) {
    var popupContent =
        "<div id='Estilo1'><h3>Valor del Suelo</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='2' width='100%' />" +
        "<div id='Estilo3a'>" +
        "<b>  </b>" + feature.properties.VALOR + "<br>" +
         "</div>";

    layer.bindPopup(popupContent);

}

function eventOpenPopup(e) {
    var layer = e.layer;
    layer.closePopup();
    layer.openPopup();
}





